(1, 1, 1, '33.23.17.2001', NULL, 'Kledung', 'gunung-sindoro-via-kledung', 'Jalur pendakian melalui Basecamp Kledung adalah salah satu jalur yang paling populer \r\ndan sering digunakan untuk mendaki Gunung Sindoro. Basecamp ini terletak di Desa Kledung, \r\nyang berada di perbatasan antara Kabupaten Temanggung dan Kabupaten Wonosobo, Jawa Tengah.\r\nJalur ini dikelola oleh GRASINSDO (Gabungan Remaja Anak Sindoro) bekerja sama dengan Perhutani\r\ndan Pemerintah Desa Kledung.\r\n\r\nJalur ini berada disepanjang lereng Tenggara, sehingga menjadi lokasi paling ideal\r\nuntuk menyaksikan matahari terbit. Pemandangan indah sepanjang perjalanan yang terbentuk dari lanskap\r\nGunung Ungaran, Merbabu, Merapi, dan Lawu menjadikannya pilihan favorit bagi banyak pendaki \r\nterlebih karena lokasinya yang berada di tepi jalan raya Wonosobo-Temanggung.\r\n\r\nPendakian melalui jalur Kledung biasanya memakan waktu sekitar 8-10 jam, \r\ntergantung pada kecepatan dan kondisi fisik pendaki.', '<ul><li><strong>Status jalur pendakian : DIBUKA (22-01-25)</strong></li><li><strong>Per-hari ini tidak ada informasi baru tentang aktifitas pendakian dan vulkanik melalui jalur ini (22-01-25)</strong></li><li>Mata air hanya tersedia di Pos 1 (±1.800 mdpl), sehingga pendaki disarankan membawa 3–4 liter air per orang.</li><li>Jalur bervariasi, mulai dari hutan tropis yang teduh di awal hingga medan berpasir dan berbatu menjelang puncak.&nbsp;</li><li>Persiapkan fisik, perlengkapan, dan jadwal mendaki pagi untuk menghindari kabut tebal di siang hari.&nbsp;</li><li>Ada warung makan di Pos 1 ojek dan Pos 2 yang rutin buka meskipun bukan akhir pekan.</li><li>Warung makan di Pos 3 umumnya buka hanya di akhir pekan.</li></ul>', '<ul><li><strong>Per-hari ini tidak ada larangan baru yang berhubungan dengan aktifitas pendakian dan vulkanik melalui jalur ini (22-01-25).</strong></li><li>Dilarang membawa tisu basah.</li><li>Wajib membawa makanan besar untuk yang melakukan pendakian <em>direct</em> tanpa menginap.</li><li>Tidak membuang sisa makanan secara terbuka di Sunrise Camp untuk menghindari datangnya babi hutan</li></ul>', 1, , 1, 1, 1, 3, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 3, 5, 5.00, '2024-11-06 23:34:59', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(2, 2, 1, '52.03.15.2005', NULL, 'Sembalun', 'gunung-rinjani-via-sembalun', 'Jalur pendakian Rinjani via Sembalun adalah rute favorit yang menawarkan perpaduan keindahan savana luas dan tantangan fisik. Dimulai dari Desa Sembalun (1.156 mdpl), jalur ini melewati padang rumput yang membentang hingga ke Pos 3 sebelum menanjak curam menuju Plawangan Sembalun di ketinggian 2.639 mdpl. Pendaki disuguhkan pemandangan spektakuler lembah hijau, panorama Samudra Hindia, dan jalur puncak yang ikonis. Meskipun treknya berat, terutama di tanjakan menuju puncak, pengalaman menyaksikan matahari terbit di Puncak Rinjani (3.726 mdpl) menjadikan jalur ini perjalanan yang tak terlupakan.', '<ul><li><strong>Tidak ada informasi baru yang berkaitan dengan aktifitas vulkanik melalui jalur ini (20-01-25).</strong></li><li>&nbsp;Sumber air hanya tersedia di Pos 2 (1.500 mdpl) dan di area sekitar Plawangan Sembalun (2.639 mdpl). Di luar titik tersebut, pendaki harus membawa persediaan air yang cukup, terutama untuk trek menuju puncak yang kering dan tanpa sumber air.&nbsp;</li><li>&nbsp;Jalur ini terkenal dengan padang savana yang mendominasi hampir 70% perjalanan awal, menawarkan pemandangan terbuka dan lanskap luas. Namun, eksposur langsung ke matahari membuat trek terasa lebih berat di siang hari.&nbsp;</li><li>&nbsp;Jalur Sembalun biasanya lebih ramai saat musim kemarau (April-Oktober) karena kondisi jalur lebih kering. Pada musim hujan, savana bisa menjadi sangat licin dan sulit dilalui.&nbsp;</li><li>Jalur Sembalun menawarkan pemandangan matahari terbit terbaik saat mendaki ke puncak, dengan latar belakang Bali, Gunung Agung, dan Samudra Hindia yang terlihat jelas pada pagi hari.</li><li>Jalur pendakian Gunung Rinjani ditutup mulai tanggal 1 hingga 10 Agustus 2025 <strong>(26-07-2025)</strong></li></ul>', '<ul><li><strong>Tidak ada larangan baru yang berkaitan dengan aktifitas pendakian dan vulkanik melalui jalur ini (20-01-25).</strong></li><li>Di area savana dan Plawangan Sembalun, menyalakan api unggun dilarang keras karena risiko kebakaran, terutama pada musim kemarau. Pendaki hanya boleh menggunakan kompor portabel untuk memasak.&nbsp;</li><li>Edelweiss dan vegetasi savana di jalur ini dilindungi. Pendaki dilarang memetik atau merusak tanaman selama perjalanan.&nbsp;</li><li>&nbsp;Pendaki hanya diperbolehkan mendirikan tenda di area yang sudah ditentukan, seperti Plawangan Sembalun atau Pos 3. Bermalam di area savana tanpa perlindungan dianggap berisiko karena perubahan cuaca ekstrem.&nbsp;</li><li>&nbsp;Pada musim hujan, jalur savana sering menjadi licin dan berbahaya. Pendakian dilarang saat kondisi cuaca buruk, terutama bila pengelola taman nasional menutup jalur secara resmi.&nbsp;</li><li>Surat sehat berlaku maksimal H-1 sebelum pendakian</li><li>Wajib isi Surat Pernyataan dan data asuransi lain yang dlrniliki</li><li>Pendaki wajib memiliki pengalaman (foto/sertifikat/wawancara)</li><li>Pendaki &lt;17 tahun wajib didampingi &amp; bawa izin ortu</li><li>Pemula wajib didampingi guide berpengalaman</li><li>Wajib mengik.uti safety briefing</li><li>Rasio 1 gude&nbsp; : 5 pendaki</li><li>Rasio 1 porter:2 pendaki asing I 3 pendaki lokal</li><li>TO wajib pastlkan standar perlengkapan pendakian</li><li>Dilarang membawa speaker aktif &amp; alat musik</li><li>Reschedule wajib melapor dan melampirkan alasan perubahan jadwal serta bukti pendukung</li></ul>', 0, , 1, 1, 1, 10, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 2, 0, 0.00, '2024-11-06 23:34:59', '2025-08-11 05:35:36', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(3, 2, 1, '52.08.04.2006', NULL, 'Senaru', 'gunung-rinjani-via-senaru', 'Jalur pendakian Rinjani melalui Senaru dikenal dengan durasi yang cukup panjang, memakan waktu sekitar 7-8 jam dari basecamp hingga Pos 3. Perjalanan dimulai dari ketinggian sekitar 600 mdpl di Desa Senaru dan mencapai batas vegetasi pada ketinggian 2.000 mdpl. Pendaki akan melewati hutan hujan tropis yang lebat sepanjang sekitar 9 km, di mana suhu bisa mencapai 15-20°C di siang hari. Jalur ini menantang tetapi menawarkan hadiah berupa pemandangan Danau Segara Anak di ketinggian 2.010 mdpl, menjadikannya pengalaman mendaki yang tak terlupakan.', '<ul><li><strong>Tidak ada informasi baru yang berkaitan dengan aktifitas vulkanik melalui jalur ini (20-01-25).</strong></li><li>Sumber air di jalur ini terbatas dan biasanya tersedia di Pos 2 dan sekitar Danau Segara Anak. Pendaki disarankan membawa persediaan air yang cukup, terutama di musim kemarau.&nbsp;</li><li>&nbsp;Jalur ini cenderung basah dan licin, terutama pada musim hujan. Pendaki disarankan membawa perlengkapan anti-air dan berhati-hati di area curam.&nbsp;</li><li>&nbsp;Beberapa area dianggap sakral dan tidak boleh dimasuki tanpa izin khusus. Pendaki bisa bertanya kepada porter atau pemandu terkait lokasi-lokasi ini.&nbsp;</li><li>Jalur pendakian Gunung Rinjani ditutup mulai tanggal 1 hingga 10 Agustus 2025 <strong>(26-07-2025)</strong></li></ul><div><br></div>', '<ul><li><strong>Tidak ada larangan baru yang berkaitan dengan aktifitas pendakian dan vulkanik melalui jalur ini (20-01-25).</strong></li><li>&nbsp;Di dekat batas vegetasi, edelweiss kerap tumbuh subur. Memetik edelweiss dilarang karena tanaman ini dilindungi, serta memiliki nilai spiritual dan simbolis bagi masyarakat Sasak.&nbsp;</li><li>&nbsp;Jalur Senaru sering mengalami masalah kebersihan akibat sampah pendaki. Pendaki wajib membawa turun semua sampah, termasuk organik, dan mengikuti prinsip Leave No Trace</li><li>Dilarang menyalakan api unggun di sepanjang jalur hingga Danau Segara Anak. Kebakaran hutan merupakan ancaman serius, terutama di musim kemarau. Hanya penggunaan kompor portabel yang diizinkan untuk memasak.&nbsp;</li><li>Surat sehat berlaku maksimal H-1 sebelum pendakian</li><li>Wajib isi Surat Pernyataan dan data asuransi lain yang dlrniliki</li><li>Pendaki wajib memiliki pengalaman (foto/sertifikat/wawancara)</li><li>Pendaki &lt;17 tahun wajib didampingi &amp; bawa izin ortu</li><li>Pemula wajib didampingi guide berpengalaman</li><li>Wajib mengik.uti safety briefing</li><li>Rasio 1 gude&nbsp; : 5 pendaki</li><li>Rasio 1 porter:2 pendaki asing I 3 pendaki lokal</li><li>TO wajib pastlkan standar perlengkapan pendakian</li><li>Dilarang membawa speaker aktif &amp; alat musik</li><li>Reschedule wajib melapor dan melampirkan alasan perubahan jadwal serta bukti pendukung</li></ul>', 0, , 1, 1, 1, 12, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 2, 1, 5.00, '2024-11-06 23:38:27', '2025-08-11 05:37:41', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(4, 2, 1, '52.08.04.2002', NULL, 'Torean', 'gunung-rinjani-via-torean', 'Gunung Rinjani melalui jalur Torean menawarkan petualangan yang memadukan panorama alam spektakuler dengan jejak spiritual dan budaya. Jalur ini dikenal dengan pemandangan lembah hijau subur, menyusuri tebing, air terjun megah, \r\nserta aliran sungai panas yang memikat. \r\n\r\nPerjalanan membawa pendaki melewati jalur yang terjal dan menantang namun penuh keajaiban, dengan latar belakang Gunung Rinjani yang megah. Cocok bagi pecinta alam yang mencari pengalaman mendalam, jalur Torean juga menawarkan suasana tenang yang jauh dari keramaian, memberikan nuansa petualangan yang tak terlupakan.', '<ul><li><strong>Tidak ada informasi baru yang berkaitan dengan aktifitas vulkanik melalui jalur ini (20-01-25).</strong></li><li>Jalur ini adalah rute tercepat untuk mencapai Danau Segara Anak, dengan waktu tempuh lebih singkat dibandingkan jalur lain.&nbsp;</li><li>Trek menantang dengan jalan setapak yang curam di beberapa titik.</li><li>Jalur ini sering digunakan oleh penduduk lokal untuk melakukan ritual di Danau Segara Anak, sehingga pendaki dapat merasakan nuansa budaya Sasak yang kental.</li><li>Pendaki dapat melihat fenomena geologi menarik seperti sungai dengan air hangat alami akibat aktivitas vulkanik Gunung Rinjani.</li><li>Jalur ini secara umum lebih ekstrem dibandingkan jalur lainnya karena beberapa bagian rutenya berada di tepi tebing yang curam. Pendaki perlu berhati-hati, terutama saat kondisi cuaca buruk.</li><li>Jalur pendakian Gunung Rinjani ditutup mulai tanggal 1 hingga 10 Agustus 2025 <strong>(26-07-2025)</strong></li><li><br></li></ul>', '<ul><li><strong>Tidak ada larangan baru yang berkaitan dengan aktifitas pendakian dan vulkanik melalui jalur ini (20-01-25).</strong></li><li>Surat sehat berlaku maksimal H-1 sebelum pendakian</li><li>Wajib isi Surat Pernyataan dan data asuransi lain yang dlrniliki</li><li>Pendaki wajib memiliki pengalaman (foto/sertifikat/wawancara)</li><li>Pendaki &lt;17 tahun wajib didampingi &amp; bawa izin ortu</li><li>Pemula wajib didampingi guide berpengalaman</li><li>Wajib mengik.uti safety briefing</li><li>Rasio 1 gude&nbsp; : 5 pendaki</li><li>Rasio 1 porter:2 pendaki asing I 3 pendaki lokal</li><li>TO wajib pastlkan standar perlengkapan pendakian</li><li>Dilarang membawa speaker aktif &amp; alat musik</li><li>Reschedule wajib melapor dan melampirkan alasan perubahan jadwal serta bukti pendukung</li></ul><div><br></div>', 0, , 1, 1, 1, 10, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 3, 0, 0.00, '2024-11-06 23:43:11', '2025-08-14 06:25:44', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(5, 3, 1, '33.07.12.1005', NULL, 'Garung', 'gunung-sumbing-via-garung', 'Gunung Sumbing, salah satu gunung tertinggi di Pulau Jawa dengan ketinggian sekitar 3.371 mdpl. Jalur ini menjadi favorit karena aksesnya yang relatif mudah dijangkau dan pemandangannya yang indah. Basecamp Garung, yang terletak di ketinggian sekitar 1.500 mdpl. Basecamp ini memiliki fasilitas lengkap, seperti kamar mandi, tempat istirahat, dan warung makan. Biasanya pendaki melakukan registrasi dan mempersiapkan logistik di sini.', '<ul><li><strong>Status jalur pendakian : DIBUKA (21-01-25)</strong></li><li><strong>Per-hari ini tidak ada informasi baru tentang aktifitas pendakian dan vulkanik melalui jalur ini (21-01-25)</strong></li><li>Terdapat ojek dari Basecamp hingga batas vegetasi.</li><li>Setelah Pos 2, jalur menjadi sangat menanjak, sehingga membutuhkan stamina yang baik.</li><li>Di area menjelang puncak, medan berupa pasir yang licin sehingga pendaki harus berhati-hati.</li><li>Tersedia air dan MCK ala kadarnya di Pos 3.</li><li>Sumber air di jalur pendakian Gunung Sumbing via Garung terdapat di dekat Pos 1, sekitar 100 meter di belakang pos ojek. Namun, perlu diperhatikan bahwa sumber air ini bisa kering saat musim kemarau, jadi bawalah persediaan air yang cukup untuk kenyamanan pendakian. <strong>(15-07-2025)</strong></li></ul>', '<ul><li><strong>Per-hari ini tidak ada larangan baru yang berhubungan dengan aktifitas pendakian dan vulkanik melalui jalur ini (21-01-25).</strong></li><li>Jalur Garung memiliki medan yang menanjak dan cukup berat, sehingga pendaki diharuskan memulai pendakian sebelum pukul 12.00 siang dari Basecamp.</li><li>&nbsp;Karena jalur Garung melewati ladang tembakau milik warga, pendaki dilarang mengambil atau membawa tembakau yang ditemukan di sepanjang jalur tanpa izin.</li><li>&nbsp;Jalur ini menyediakan layanan porter lokal, dan pendaki disarankan menggunakan jasa mereka untuk mengurangi beban dan memberikan manfaat ekonomi kepada warga setempat. &nbsp;</li><li>&nbsp;Pendaki yang ingin mendekati kawah di area puncak harus melapor terlebih dahulu ke pengelola basecamp. Hal ini dilakukan untuk memantau aktivitas kawah yang kadang mengeluarkan gas beracun.&nbsp;</li></ul>', 1, , 1, 1, 1, 4, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 3, 1, 5.00, '2024-10-04 21:53:58', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(6, 4, 1, '33.03.10.2002', NULL, 'Bambangan', 'gunung-slamet-via-bambangan', 'Jalur pendakian Gunung Slamet melalui Bambangan di Purbalingga memiliki panjang sekitar 7 km dengan waktu tempuh pendakian naik 8–12 jam dan turun 5–7 jam. Dimulai dari basecamp di ketinggian ±1.480 mdpl, pendaki melewati 9 pos utama hingga mencapai puncak setinggi 3.428 mdpl. Jalur awal cenderung landai dengan vegetasi hutan tropis, tetapi mulai dari Pos 3, tanjakan menjadi lebih tajam, berbatu, dan semakin menantang di atas Pos 7 hingga zona bebatuan vulkanik menuju puncak. Dengan kemiringan rata-rata 30–45 derajat, jalur ini menuntut stamina yang baik, terutama menghadapi angin kencang dan suhu rendah hingga 5°C di puncak. Sepanjang perjalanan, pendaki disuguhkan keindahan hutan lebat, lembah hijau, dan panorama gunung lainnya seperti Merapi, Merbabu, Sindoro, dan Ciremai. Fasilitas dasar tersedia di Basecamp Bambangan, dan jalur ini sering menjadi favorit berkat aksesibilitasnya, meskipun tetap menantang bagi pendaki menengah hingga lanjutan.', '<ul><li><strong>Pendakian jalur ini : DIBUKA (20-01-25).</strong></li><li><strong>G. Slamet Level II (Waspada) (20-01-25).</strong></li><li><strong>Tidak ada informasi baru yang berkaitan dengan peningkatan aktifitas vulkanik melalui jalur ini (20-01-25).</strong></li><li>Jalur pendakian Gunung Slamet melalui Bambangan memiliki mata air di sekitar Pos 2, tetapi sumber air ini tidak selalu tersedia sepanjang tahun, terutama pada musim kemarau, sehingga pendaki disarankan membawa pasokan air yang cukup sejak basecamp.&nbsp;</li><li>Untuk bermalam, lokasi yang direkomendasikan adalah Pos 4 (Samaranthu), karena memiliki area datar yang cukup luas dan terlindung dari angin. Pos 7 juga menjadi pilihan, meskipun kapasitasnya terbatas dan angin lebih kencang.&nbsp;</li><li>Warung makan, biasanya hanya tersedia di sekitar basecamp, sehingga pendaki perlu mempersiapkan perbekalan sendiri untuk jalur di atas. Perencanaan logistik yang matang sangat penting, mengingat tidak ada fasilitas tambahan di ketinggian setelah Pos 2.&nbsp;</li></ul>', '<ul><li><strong>Tidak ada larangan baru yang berkaitan dengan aktifitas pendakian dan vulkanik melalui jalur ini (20-01-25).</strong></li><li>Semua pendaki harus melakukan registrasi di Basecamp Bambangan dengan menyerahkan identitas diri dan mengisi formulir pendakian.</li><li>Terdapat batas kuota harian untuk mencegah overkapasitas, terutama di musim liburan.</li><li>Pendaki diwajibkan membawa peralatan standar, termasuk jaket tebal, senter, P3K, dan tenda.</li><li>Semua sampah yang dibawa harus dibawa turun kembali. Pendaki dianjurkan membawa kantong sampah pribadi.</li><li>Pendaki solo harus melapor khusus, dan disarankan untuk mendaki minimal berdua demi keselamatan.</li><li>Dilarang keras meninggalkan sampah di sepanjang jalur maupun di puncak.</li><li>Menyalakan api unggun dilarang di atas Pos 1 untuk menghindari kebakaran hutan.</li><li>Pendaki tidak diperbolehkan memetik tanaman atau merusak vegetasi di sepanjang jalur.</li><li>Alkohol dan narkotika tidak diizinkan, demi menjaga keamanan dan ketertiban.</li><li>Semua aktivitas komersial seperti pembuatan konten atau promosi memerlukan izin khusus dari pengelola.</li><li>Melakukan pendakian di luar jalur resmi atau melewati batas aman, seperti area berbahaya di puncak kawah, sangat dilarang karena risiko keselamatan.</li></ul>', 0, , 1, 1, 1, 10, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 2, 2, 5.00, '2024-12-12 11:21:36', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(7, 4, 1, '33.28.02.2001', NULL, 'Guci', 'gunung-slamet-via-guci', 'Jalur pendakian Gunung Slamet melalui Guci, Tegal, adalah salah satu rute favorit karena menawarkan pemandangan alam yang memukau dan aksesibilitas yang cukup baik. Jalur ini memiliki panjang sekitar 10 km dengan waktu tempuh rata-rata 7–10 jam tergantung pada kondisi fisik pendaki dan cuaca. Pos pendakian dimulai di ketinggian sekitar 1.300 mdpl, melalui beberapa pos seperti Pos Kalipagu, Pos Bengkok, dan Pos Cemara hingga mencapai puncak di ketinggian 3.428 mdpl. Medan pendakian bervariasi, mulai dari jalur tanah yang relatif landai hingga tanjakan curam berbatu mendekati puncak. Vegetasi di sepanjang jalur didominasi oleh hutan tropis lebat di awal perjalanan, yang kemudian berubah menjadi tumbuhan semak khas pegunungan di ketinggian. Jalur ini juga menawarkan panorama indah berupa lembah hijau, mata air alami, dan udara sejuk, menjadikannya pengalaman mendaki yang menantang namun memuaskan.', '<ul><li>Pendaki dapat memulai perjalanan dari Basecamp Gupala atau Basecamp Kompak, memberikan fleksibilitas dalam perencanaan pendakian.</li><li>Total waktu pendakian hingga puncak dapat mencapai sekitar 10 jam, dengan jarak antar pos yang relatif jauh.</li><li>Jalur ini dikenal menantang, dengan kombinasi medan curam, trek berbatu, dan tanjakan panjang.</li><li>Jalur Guci lebih jarang dilalui dibandingkan jalur lain seperti Bambangan, memberikan pengalaman mendaki yang lebih tenang dan alami.</li><li>Di sekitar Desa Guci terdapat pemandian air panas alami yang dapat dinikmati sebelum atau setelah pendakian untuk melepas lelah.</li><li>Meskipun terdapat sumber air bersih di beberapa pos, seperti Pos 4 yang memiliki akses ke air bersih dan fasilitas MCK, pendaki disarankan membawa persediaan air yang cukup dari awal pendakian untuk memastikan kebutuhan selama perjalanan terpenuhi.&nbsp;</li><li>Jalur ini menawarkan panorama lembah hijau yang indah, hutan tropis, dan pemandangan khas pegunungan.</li></ul>', '<ul><li>Larangan Membuat Api Unggun: Pendaki dilarang membuat api unggun selama pendakian untuk mencegah risiko kebakaran hutan.&nbsp;</li><li>Membawa minuman keras dan narkoba selama pendakian dilarang keras, mengingat Gunung Slamet dianggap sebagai tempat yang sakral dan perlu dijaga kesuciannya.&nbsp;</li><li>Pendaki diwajibkan menjaga kebersihan dengan tidak membuang sampah sembarangan untuk melestarikan keasrian lingkungan gunung.&nbsp;</li><li>Tidak ada laporan signifikan mengenai keberadaan binatang buas di jalur pendakian via Guci. Namun, pendaki tetap harus waspada dan menjaga kebersihan serta tidak meninggalkan sisa makanan yang dapat menarik satwa liar.</li></ul><div><br><br></div>', 0, , 1, 1, 1, 10, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 3, 1, 5.00, '2024-12-12 11:44:49', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700);
INSERT INTO `rute` (`id`, `gunung_id`, `negara_id`, `kode_desa`, `lokasi`, `nama`, `slug`, `deskripsi`, `informasi`, `aturan_dan_larangan`, `is_verified`, `rute`, `is_cuaca_siap`, `is_kalori_siap`, `is_kriteria_jalur_siap`, `segmentasi`, `a_k`, `b_k`, `c_k`, `d_k`, `a_wt`, `b_wt`, `c_wt`, `d_wt`, `e_wt`, `f_wt`, `a_cps`, `b_cps`, `c_kr`, `d_kr`, `e_kr`, `f_kr`, `g_kr`, `h_kr`, `rute_tingkat_kesulitan_id`, `comment_count`, `comment_rating`, `created_at`, `updated_at`, `g_wt`, `h_wt`, `i_wt`, `j_wt`, `k_wt`) VALUES
(8, 4, 1, '33.02.22.2012', NULL, 'Baturraden', 'gunung-slamet-via-baturraden', 'Jalur pendakian Gunung Slamet melalui Baturaden menawarkan pengalaman mendaki yang menantang dengan panjang jalur sekitar 8 km dan estimasi waktu pendakian 10–12 jam hingga ke puncak, tergantung kecepatan pendaki. Dimulai dari ketinggian sekitar 650 mdpl di kawasan wisata Baturaden, jalur ini membawa pendaki melewati hutan hujan tropis yang lebat, vegetasi alami, dan satwa liar yang beragam. Medannya terjal dengan tanjakan curam mencapai kemiringan 40–60 derajat di beberapa titik, terutama mendekati puncak di ketinggian 3.428 mdpl, sehingga cocok untuk pendaki berpengalaman. Keasrian jalur ini, yang relatif jarang dilewati, memberikan suasana eksklusif, sementara puncaknya menyuguhkan panorama spektakuler Jawa Tengah, termasuk hamparan awan dan gunung-gunung di sekitarnya.', '<ul><li>Pendaki perlu mengurus perizinan di basecamp Baturaden. Menggunakan jasa pemandu lokal sangat disarankan, terutama karena jalur ini kurang populer dan minim tanda penunjuk arah.</li><li>Mata air terakhir di jalur pendakian Gunung Slamet melalui Baturaden biasanya ditemukan di sekitar Pos 2 atau Pos 3, tergantung kondisi musim dan curah hujan. Pada musim kemarau, debit mata air ini sering berkurang atau bahkan kering, sehingga pendaki disarankan untuk mengisi penuh persediaan air di pos tersebut.&nbsp;</li><li>&nbsp;Cuaca di jalur ini bisa berubah cepat, dengan potensi kabut tebal dan hujan yang membuat jalur licin. Pastikan membawa pakaian tahan air dan perlengkapan mendaki yang memadai.&nbsp;</li></ul><div><br><br><br><br></div>', '<ul><li>&nbsp;Jalur ini memiliki medan terjal dan minim tanda penunjuk arah, sehingga tersesat menjadi risiko besar. Selalu berjalan dalam kelompok atau dengan pemandu lokal.&nbsp;</li><li>&nbsp;Membuat api unggun dilarang keras karena risiko kebakaran hutan yang tinggi, terutama di musim kemarau. Gunakan alat masak portabel jika diperlukan.&nbsp;</li><li>&nbsp;Semua sampah harus dibawa kembali turun. Gunung Slamet adalah kawasan konservasi, dan meninggalkan sampah merusak ekosistem serta keindahan jalur.&nbsp;</li></ul>', 0, , 1, 1, 1, 10, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 3, 0, 0.00, '2024-12-12 11:49:03', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(9, 5, 1, '35.20.07.2001', NULL, 'Cemoro Sewu', 'gunung-lawu-via-cemoro-sewu', 'Jalur favorit', '<ul><li><strong>Status jalur pendakian : DIBUKA (23-01-25)</strong></li><li><strong>Per-hari ini tidak ada informasi baru tentang aktifitas pendakian dan vulkanik melalui jalur ini (23-01-25)</strong></li><li>Jalur dimodifikasi berdasarkan sumber asal: <a href=\"https://www.wikiloc.com/hiking-trails/cemarasewu-cemarasewu-42099335\">https://www.wikiloc.com/hiking-trails/cemarasewu-cemarasewu-42099335</a></li><li>Foto diambil dari sumber : <a href=\"https://travel.kompas.com/read/2021/04/22/155500127/pendaki-pemula-gunung-lawu-via-karanganyar-wajib-pendamping-bagaimana-dengan\">https://travel.kompas.com/read/2021/04/22/155500127/pendaki-pemula-gunung-lawu-via-karanganyar-wajib-pendamping-bagaimana-dengan</a></li></ul>', '<ul><li><strong>Per-hari ini tidak ada larangan baru yang berhubungan dengan aktifitas pendakian dan vulkanik melalui jalur ini (23-01-25).</strong></li></ul><div><br></div>', 0, , 1, 1, 1, 10, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 2, 2, 5.00, '2024-12-28 20:58:57', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(10, 6, 1, '15.01.09.2012', NULL, 'Kersik Tuo', 'gunung-kerinci-via-kersik-tuo', 'Jalur utama', '<ul><li>Sumber air di jalur pendakian Gunung Kerinci via Kersik Tuo dapat ditemukan di dekat Pintu Rimba, sekitar 200 meter setelah pintu masuk jalur pendakian. Selain itu, Taman Nasional Kerinci Seblat (TNKS) juga telah menyediakan sumber air di beberapa titik sepanjang jalur pendakian untuk memudahkan para pendaki, Kondisi sumber air dapat berubah tergantung pada musim dan cuaca, oleh karena itu penting untuk selalu waspada dan memeriksa kondisi sumber air sebelum menggunakannya.&nbsp;<strong>(04-07-2025)</strong></li></ul>', '<div>none a while</div>', 0, , 1, 1, 1, 6, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 3, 0, 0.00, '2024-12-28 23:13:30', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(11, 7, 1, '35.10.24.2007', NULL, 'Paltuding', 'gunung-ijen-via-paltuding', 'Paling populer', '<ul><li>Dari Banyuwangi atau Bondowoso, kota terdekat. Sewa mobil, ikuti tur, atau naik skuter ke Paltuding Base Camp, titik awalnya.</li><li>Pendaki wajib memperoleh surat keterangan sehat di Pos Kesehatan Wisata, Paltuding (<a href=\"https://www.rri.co.id/jember/wisata/1250155/pos-kesehatan-wisata-pendaki-ijen-wajib-punya-suket\">https://www.rri.co.id/jember/wisata/1250155/pos-kesehatan-wisata-pendaki-ijen-wajib-punya-suket</a>)</li><li>Jalur dimodifikasi dari sumber asal: <a href=\"https://www.wikiloc.com/hiking-trails/ijen-volcano-38545425\">https://www.wikiloc.com/hiking-trails/ijen-volcano-38545425</a></li><li>Foto diambil dari sumber: <a href=\"https://bappeda.jatimprov.go.id/2023/06/04/gunung-ijen-ditetapkan-sebagai-unesco-global-geopark/\">https://bappeda.jatimprov.go.id/2023/06/04/gunung-ijen-ditetapkan-sebagai-unesco-global-geopark/</a></li><li>Sumber air utama di jalur pendakian Gunung Ijen via Paltuding adalah air dari mata air Gunung Ranti. Mata air ini memiliki debit yang cukup besar, sekitar 11 liter per detik, dan berada pada ketinggian 2.400 mdpl. Air dari mata air ini dialirkan dan dimanfaatkan untuk kebutuhan di Paltuding (pos pendakian) dan area sekitar Kawah Ijen, termasuk TWA (Taman Wisata Alam) Kawah Ijen.&nbsp;<strong>(04-07-2025)</strong></li></ul>', '<div><strong>Pendaki juga wajib mengetahui dan mematuhi batas zona resiko sepanjang jalur pendakian berupa, bendera hijau (aman) meliputi jalur Paltuding-Pondok Bunder; bendera kuning (waspada), yakni jalur Pondok Bunder-Blok Kelek (Cemara 1) serta bendera merah (bahaya/resiko tinggi), jalur Blok Kelek-Puncak Ijen</strong> (<a href=\"https://www.tempo.co/hiburan/kuota-kunjungan-ke-twa-kawah-ijen-dibatasi-2-000-orang-saat-libur-nataru-1184919\">https://www.tempo.co/hiburan/kuota-kunjungan-ke-twa-kawah-ijen-dibatasi-2-000-orang-saat-libur-nataru-1184919</a>).</div>', 0, , 1, 1, 1, 10, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 1, 1, 5.00, '2024-12-28 23:49:59', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(12, 8, 1, '33.07.13.2003', NULL, 'Telaga Cebong', 'gunung-sikunir-via-telaga-cebong', 'Tujuan populer akhir pekan', '<ul><li>Jalur ini dimodifikasi berdasarkan sumber asal : <a href=\"https://www.wikiloc.com/hiking-trails/bukit-sikunir-99314956\">https://www.wikiloc.com/hiking-trails/bukit-sikunir-99314956</a></li><li>Foto diambil dari sumber asal: <a href=\"https://travel.kompas.com/read/2020/07/17/151700627/bukit-sikunir-buka-lagi-ini-5-fakta-menariknya?page=all\">https://travel.kompas.com/read/2020/07/17/151700627/bukit-sikunir-buka-lagi-ini-5-fakta-menariknya?page=all</a></li><li>Belum adanya info mengenai sumber air yang bisa di manfaatkan bagi pendaki, akan tetapi jalur ini adalah jalur ramai dan sudah banyak pedagang walau tidak membawa air yang cukup&nbsp;<strong>(23-06-2025)</strong></li></ul>', '<div>Dilarang membuang sampah sepanjang jalur dengan alasan apapun</div>', 1, , 1, 1, 1, 10, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 1, 0, 0.00, '2024-12-29 04:56:09', '2025-08-01 23:21:10', 0.0200, 0.8000, 5.0000, 0.1500, 0.0700);
