(13, 9, 1, '35.08.12.2012', NULL, 'Ranu Pani', 'gunung-semeru-via-ranu-pani', 'Basecamp populer', '<ul><li><strong>Penutupan seluruh jalur pendakian Gunung Semeru hingga 8 Februari 2025 (20-01-25).</strong></li><li>Jalur merupakan hasil modifikasi dari sumber asal :<a href=\"https://www.santridanalam.com/2014/10/tracklog-pendakian-gunung-indonesia.html\"> https://www.santridanalam.com/2014/10/tracklog-pendakian-gunung-indonesia.html</a></li><li>Sumber foto depan dari Wikipedia: <a href=\"https://id.wikipedia.org/wiki/Gunung_Semeru\">https://id.wikipedia.org/wiki/Gunung_Semeru</a></li><li>Sumber air utama di jalur pendakian Gunung Semeru via Ranu Pani adalah Ranu Kumbolo dan Sumber Mani. Ranu Kumbolo, sebuah danau air tawar, terletak di jalur pendakian dan menyediakan air yang cukup untuk kebutuhan selama perjalanan ke Ranu Kumbolo. Setelah melewati Ranu Kumbolo, pendaki perlu membawa persediaan air yang cukup karena sumber air berikutnya adalah Sumber Mani, yang terletak sekitar 1 kilometer dari Kalimati ke arah barat.&nbsp;<strong>(04-07-2025)</strong></li></ul>', '<ul><li><strong>Gunung Semeru saat ini berstatus Waspada atau Level 2 (20-01-25).</strong></li><li>Jalur pendakian Gunung Semeru mulai dibuka pada 16 Mei 2025, tapi Hingga Ranu Kumbolo<strong> (18-05-2025)</strong></li><li>Kuotanya 200 orang hingga Ranu Kumbolo. Durasi pendakian 2 hari 1 malam. Seluruh pendaki juga diwajibkan mengikuti SOP https://bromotenggersemeru.id <strong>(24-04-2025)</strong></li></ul>', 1, , 1, 1, 1, 65, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 400.0000, 450.0000, 4.0000, 3.0000, 0.0500, 3, 1, 5.00, '2024-12-30 21:11:56', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700);
