(14, 11, 1, '32.02.17.2004', NULL, 'Javana Spa Cidahu', 'gunung-salak-via-javana-spa-cidahu', 'Jalur alternatif', '<ul><li><strong>Status jalur pendakian : DITUTUP dari 7 Desember 2024 hingga waktu yang belum ditentukan&nbsp; (21-01-25)</strong></li><li><strong>Per-hari ini tidak ada informasi baru tentang aktifitas pendakian dan vulkanik melalui jalur ini (21-01-25)</strong></li><li>Sumber air di jalur pendakian Gunung Salak via Javana Spa Cidahu terdapat di beberapa titik. Selain itu, jalur ini juga melewati sungai-sungai yang bisa menjadi sumber air, namun disarankan untuk menghindari air yang berasal dari dekat kawah.&nbsp;<strong>(04-07-2025)</strong></li></ul>', '<ul><li><strong>Per-hari ini tidak ada larangan baru yang berhubungan dengan aktifitas pendakian dan vulkanik melalui jalur ini (21-01-25).</strong></li></ul><div><br></div>', 0, , 1, 1, 1, 12, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 3, 0, 0.00, '2025-01-03 23:41:07', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(15, 10, 1, '32.03.10.2003', NULL, 'Gunung Putri', 'gunung-gede-via-gunung-putri', 'Gunung populer dekat Jakarta', '<div><br></div><ul><li>Peningkatan gempa vulkanik dalam Gunung Gede Pangrango<strong> di tutup </strong>diperpanjang sampai dengan 13 April 2025 (<strong>10-04-2025</strong>)</li><li>Sumber air yang dapat ditemukan saat pendakian Gunung Gede via jalur Putri terbatas. Mata air utama berada di area awal pendakian, setelah tempat pembuangan sampah. Sumber air lainnya hanya tersedia di Pos 5, yaitu di Alun-alun Suryakencana. Untuk itu, penting bagi pendaki untuk membawa persediaan air yang cukup karena tidak akan ada sumber air lain di antara titik-titik tersebut.&nbsp;<strong>(19-06-2025)</strong></li></ul>', '<ul><li>Terjadi peningkatan aktifitas vulkanik</li></ul><div><br></div>', 0, , 1, 1, 1, 20, 0.7900, 1.0300, 1.0700, 35.2000, 11.6650, 5.2860, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 2, 0, 0.00, '2025-01-04 17:41:46', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(17, 15, 1, '13.02.07.2007', NULL, 'Air Batumbuk', 'gunung-talang-via-air-batumbuk', 'Jalur populer', '<ul><li>Sumber air di jalur pendakian Gunung Talang via Air Batumbuk terdapat di Rambu 6 (R6) dan Rambu 54 (R54). Disarankan untuk mengisi air sebanyak mungkin di R6 karena aliran air di R54 tidak selalu tersedia, terutama pada musim kemarau.&nbsp;<strong>(04-07-2025)</strong></li></ul>', '<div>none</div>', 0, , 1, 1, 1, 20, 0.7900, 1.0300, 1.0700, 35.2000, 11.6650, 5.2860, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 3, 0, 0.00, '2025-01-05 06:52:39', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(18, 16, 1, '32.03.10.2003', NULL, 'Cibodas', 'gunung-pangrango-via-cibodas', 'Puncak Gunung Pangrango dapat dicapai melalui jalur pendakian tercepat yang berbentuk persimpangan di Kandang Badak dari jalur Cibodas. Jarak ke puncak Gunung Pangrango sekitar 4 jam pendakian dari persimpangan Kandang Badak. Jalur lain yang dapat digunakan untuk menuju ke puncak Gunung Pangrango adalah Jalur Gunung Putri (Cipanas) atau Jalur Salabintana (Perbawati), dimana pendaki harus melewati puncak Gunung Gede terlebih dahulu sebelum turun menuju ke Kandang Badak. Puncak Gunung Pangrango cukup sulit untuk didaki karena lerengnya yang terjal dan hampir mendekati posisi tegak atau vertikal.', '<ul><li><strong>Status jalur pendakian : DITUTUP dari 25 Desember 2024 hingga 31 Maret 2025&nbsp; (21-01-25)</strong></li><li><strong>Per-hari ini tidak ada informasi baru tentang aktifitas pendakian dan vulkanik melalui jalur ini (21-01-25)</strong></li><li>Sumber air di jalur pendakian Gunung Pangrango via Cibodas, bagi pendaki disarankan untuk membawa air minum yang cukup karena ketersediaan sumber air terbatas di jalur pendakian.&nbsp;<strong>(05-07-2025)</strong></li></ul><div><br></div>', '<ul><li><strong>Per-hari ini tidak ada larangan baru yang berhubungan dengan aktifitas pendakian dan vulkanik melalui jalur ini (21-01-25).</strong></li></ul><div><br></div>', 0, , 1, 1, 1, 20, 0.7900, 1.0300, 1.0700, 35.2000, 11.6650, 5.2860, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 2, 0, 0.00, '2025-01-05 09:19:18', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700);
