(19, 10, 1, '32.03.10.2003', NULL, 'Cibodas', 'gunung-gede-via-cibodas', NULL, '<div><br></div><ul><li>Peningkatan gempa vulkanik dalam Gunung Gede Pangrango<strong> di tutup</strong> diperpanjang sampai dengan 13 April 2025 (<strong>10-04-2025</strong>)</li><li>Sumber air di jalur pendakian Gunung Gede via cibodas terbatas. Sebaiknya pendaki membawa persediaan air yang cukup&nbsp;<strong>(19-06-2025)</strong></li></ul><div><br></div>', '<ul><li>Terjadi peningkatan aktifitas vulkanik</li></ul><div><br></div>', 0, , 1, 1, 1, 20, 0.7900, 1.0300, 1.0700, 35.2000, 11.6650, 5.2860, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 2, 0, 0.00, '2025-01-05 09:44:47', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(20, 10, 1, '32.02.32.2006', NULL, 'Selabintana', 'gunung-gede-via-selabintana', NULL, '<div><br></div><ul><li>Peningkatan gempa vulkanik dalam Gunung Gede Pangrango<strong> di tutup</strong> diperpanjang sampai dengan 13 April 2025 (<strong>10-04-2025</strong>)</li><li>Sumber air di jalur pendakian Gunung Gede via Selabintana terbatas. Sebaiknya pendaki membawa persediaan air yang cukup, karena belum ada sumber yang pasti tentang ketersediaan sumber air di jalur pendakian&nbsp;<strong>(19-06-2025)</strong></li></ul>', '<ul><li>Aktifitas vulkanik meningkat</li></ul><div><br></div>', 0, , 1, 1, 1, 20, 0.7900, 1.0300, 1.0700, 35.2000, 11.6650, 5.2860, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 2, 0, 0.00, '2025-01-05 10:22:06', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(21, 17, 1, '32.10.05.2005', NULL, 'Apuy', 'gunung-ceremai-via-apuy', 'Jalur terpopuler', '<ul><li><strong>Status jalur pendakian : DIBUKA (26-02-25)</strong></li><li><strong>Per-hari ini tidak ada informasi baru tentang aktifitas pendakian dan vulkanik melalui jalur ini (26-02-25)</strong></li><li>Sumber air di jalur pendakian Gunung Ciremai via Apuy sangat terbatas. Pendaki disarankan untuk mengisi persediaan air secukupnya di basecamp Apuy atau di Pos 1 (Cigowong), karena setelah itu belum ada informasi sumber air hingga ke puncak. &nbsp;<strong>(05-07-2025)</strong></li></ul>', '<div><strong>Masyarakat dan pengunjung/wisatawan disarankan tidak mendekati ke kawah G. Ciremai dalam radius 500 meter </strong>(<a href=\"https://tngciremai.menlhk.go.id/\">https://tngciremai.menlhk.go.id/</a>).</div>', 0, , 1, 1, 1, 8, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 75.0000, 60.0000, 2.0000, 3.0000, 0.0500, 2, 0, 0.00, '2025-01-10 07:18:41', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
