(23, 20, 1, '73.16.10.2003', NULL, 'Karangan', 'gunung-latimojong-via-karangan', 'Jalur favorit', '<div>none at this time</div>', '<div>none at this time</div>', 0, , 1, 1, 1, 8, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 3, 0, 0.00, '2025-01-18 06:28:12', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(24, 21, 1, '51.07.01.2004', NULL, 'Pura Agung Besakih', 'gunung-agung-via-pura-agung-besakih', 'Jalur paling banyak dipilih', '<ul><li>Status jalur pendakian : Di Tutup 25 Februari 2025 hingga 5 hari kedepan (<strong>25-02-2025</strong>)</li><li>Sumber air di sekitar Gunung Agung, terutama yang berkaitan dengan Pura Besakih, adalah sumber air suci yang dikelola dan dijaga kelestariannya oleh masyarakat sekitar. Baiknya membawa perbekalan air yang cukup untuk epnadian&nbsp;<strong>(19-06-2025)</strong></li></ul>', '<ul><li>mata air suci bernama Tirta Suci Giri Kusuma yang berada di ketinggian 2.062 mdpl dan dianggap sebagai sumber air tertinggi di Gunung Agung, namun airnya tidak boleh diambil sembarangan. <strong>(19-06-2025)</strong></li></ul>', 0, , 1, 1, 1, 6, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 2, 0, 0.00, '2025-01-21 18:06:40', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(26, 22, 1, '91.09.10.2018', NULL, 'Tembagapura', 'gunung-jayawijaya-via-tembagapura', 'Basecamp jalur normal\r\n\r\n(Catatan: informasi kondisi cuaca belum akurat dikarenakan tidak terdapat data dari BMKG di titik keberangkatan)', '<ul><li>Sumber air utama di jalur pendakian Gunung Jayawijaya via Tembagapura, pendaki perlu membawa persediaan air yang cukup, karena tidak banyak sumber air alami di sepanjang jalur pendakian.&nbsp;<strong>(05-07-2025)</strong></li></ul>', '<div>none</div>', 0, , 1, 1, 1, 8, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 4, 0, 0.00, '2025-01-21 21:39:24', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(27, 23, 1, '82.71.06.1011', NULL, 'Moya (Makassar Barat)', 'gunung-gamalama-via-moya-makassar-barat', 'Jalur pendakian utama', '<ul><li>Sumber air di jalur pendakian Gunung Gamalama via Moya ada dua, yaitu Air Belanda di Pos 1 dan Air Abdas di Pos 4. Namun, keberadaan Air Abdas tidak selalu ada, tergantung keberuntungan. Sebaiknya pendaki mempersiapkan persediaan air yang cukup saat pendakian.&nbsp;<strong>(05-07-2025)</strong></li></ul>', '<div>Per-hari ini PVMBG memberikan rekomendasi agar masyarakat dan wisatawan tidak mendekati area dalam radius 1,5 km dari kawah utama<a href=\"https://www.okezone.com/tag/gunung-gamalama\">&nbsp;</a></div>', 0, , 1, 1, 1, 8, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 75.0000, 60.0000, 2.0000, 3.0000, 0.0500, 1, 0, 0.00, '2025-01-22 04:16:19', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700);
