(28, 24, 1, '53.07.09.2008', NULL, 'Nangatobong', 'gunung-egon-via-nangatobong', 'Jalur ramai', '<ul><li><strong>Status jalur pendakian : DIBUKA (25-01-25)</strong></li><li><strong>Per-hari ini tidak ada informasi baru tentang aktifitas pendakian dan vulkanik melalui jalur ini (25-01-25)</strong></li><li>Jalur pendakian Gunung Egon via Nangatobong tidak memiliki sumber air alami yang bisa diandalkan. Bawa air minum yang cukup dari bawah dan lakukan persiapan yang matang sebelum memulai pendakian.&nbsp;<br><br></li></ul>', '<ul><li><strong>Per-hari ini tidak ada larangan baru yang berhubungan dengan aktifitas pendakian dan vulkanik melalui jalur ini (25-01-25).</strong></li></ul><div><br></div>', 0, , 1, 1, 1, 5, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 75.0000, 60.0000, 2.0000, 3.0000, 0.0500, 2, 0, 0.00, '2025-01-22 17:54:01', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(29, 25, 1, '12.06.15.2005', NULL, 'Jaranguda', 'gunung-sibayak-via-jaranguda', 'Jalur favorit', '<ul><li>Ada sumber air sekitar pemandian air panas Lau Sidebuk-debuk yang terletak di kaki gunung, tetapi disarankan untuk membawa air minum yang cukup, terutama jika berencana untuk mendaki dalam waktu yang lama atau dalam kondisi cuaca panas. <strong>(05-07-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 8, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 2, 0, 0.00, '2025-01-22 18:26:05', '2025-08-01 23:21:10', 0.0200, 0.8000, 5.0000, 0.1500, 0.0700),
(30, 26, 1, '61.05.19.2002', NULL, 'Ferrata', 'gunung-kelam-via-ferrata', 'Jalur normal', '<ul><li>Sumber air di jalur pendakian Gunung Kelam via Ferrata cukup melimpah. Beberapa sumber mata air tersedia di sepanjang jalur yang bisa langsung dikonsumsi. Gunung Kelam sendiri juga merupakan sumber mata air bersih bagi masyarakat setempat.&nbsp;<strong>(05-07-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 6, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 2, 0, 0.00, '2025-01-22 21:16:44', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(31, 27, 1, '33.07.13.2014', NULL, 'Patak Banteng', 'gunung-prau-parahu-via-patak-banteng', 'Jalur favorit', '<ul><li>Sumber air di jalur pendakian Gunung Prau via Patakbanteng tidak tersedia langsung di jalur, namun pengelola basecamp telah membuat saluran air dengan pipa yang mengalirkan air dari sumber mata air ke jalur pendakian melalui kran yang bisa dibuka tutup. Jadi, pendaki bisa mengambil air di kran tersebut. <strong>(23-06-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 5, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 2, 3, 5.00, '2025-01-22 21:45:10', '2025-08-13 10:08:05', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(32, 28, 1, '32.17.02.2001', NULL, 'Trek 11 Karyawangi', 'gunung-upas-via-trek-11-karyawangi', 'Rute normal', '<ul><li>Sumber air pada jalur pendakian Gunung Upas via Trek 11 Karyawang, yang juga dikenal sebagai Upas Hill, umumnya tidak tersedia secara langsung di jalur pendakian itu sendiri. Pendaki biasanya membawa air minum yang cukup dari titik awal pendakian atau mencari sumber air di sekitar area parkir sebelum memulai pendakian. Beberapa pendaki mungkin menemukan mata air kecil di dekat jalur, namun tidak dapat dipastikan ketersediaannya sepanjang waktu.&nbsp;<strong>(05-07-2025)</strong></li></ul>', '<div>none at this moment</div>', 0, , 1, 1, 1, 5, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 1, 0, 0.00, '2025-01-23 00:17:08', '2025-08-01 23:21:10', 0.0200, 0.8000, 5.0000, 0.1500, 0.0700),
(33, 29, 1, '52.05.06.2003', NULL, 'Pancasila', 'gunung-tambora-via-pancasila', 'Jalur utama', '<ul><li>Ada informasi untuk sumber air hanya ada di pos 1, atau sekitar 150m dari pos 1, sehingga pendaki harus membawa air yang cukup dari bawah.&nbsp;<strong>(02-07-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 8, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 2, 0, 0.00, '2025-01-23 02:00:25', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(34, 30, 1, '51.06.04.2027', NULL, 'Pura Pasar Agung', 'gunung-batur-via-pura-pasar-agung', 'Jalur pendakian wisata', '<div>none at this time</div>', '<ul><li><br></li></ul>', 0, , 1, 1, 1, 5, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 1, 0, 0.00, '2025-01-23 17:57:47', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(35, 31, 1, '33.02.22.2012', NULL, 'Kalipagu', 'gunung-curug-jenggala-via-kalipagu', 'Jalur wisata', '<ul><li>Ada sumber air, tetapi untuk traking di harapkan membawa air minum yang cukup dari bawah.</li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 8, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 1, 1, 5.00, '2025-01-24 00:21:28', '2025-08-01 23:21:10', 0.0200, 0.8000, 5.0000, 0.1500, 0.0700),
(36, 32, 1, '71.73.03.1004', NULL, 'Kakaskasen Satu', 'gunung-lokon-via-kakaskasen-satu', 'Jalur normal', '<ul><li><strong>Status Gunung: SIAGA atau level III (25-01-25)</strong></li><li>Tidak ada informasi yang menyatakan adaya sumber air, Pendaki disarankan untuk membawa persediaan air yang cukup dari bawah atau memanfaatkan sumber air yang ada di sekitar permukiman sebelum memulai pendakian.&nbsp;<strong>(03-07-2024)</strong></li></ul><div><br></div><div><br></div>', '<ul><li><strong>Menghindari area sejauh 1,5 kilometer dari Kawah Tompaluan (25-01-25)</strong></li></ul>', 0, , 1, 1, 1, 5, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 1, 0, 0.00, '2025-01-25 00:16:25', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
