(38, 34, 1, '81.01.14.2002', NULL, 'Waai', 'gunung-salahutu-via-waai', 'Jalur wisata', '<ul><li><strong>Status jalur pendakian : DIBUKA (25-01-25)</strong></li><li><strong>Per-hari ini tidak ada informasi baru tentang aktifitas pendakian melalui jalur ini (25-01-25)</strong></li><li>Informasi Sumber air pada jalur pendakian Gunung Salahutu via Waai terletak di <strong>Sungai Waai Tasoi</strong>. Sungai ini merupakan titik terakhir sumber air yang bisa ditemukan dalam perjalanan mendaki&nbsp;<strong>(03-07-2025)</strong></li></ul>', '<ul><li><strong>Per-hari ini tidak ada larangan baru yang berhubungan dengan aktifitas pendakian melalui jalur ini (25-01-25).</strong></li></ul>', 0, , 1, 1, 1, 8, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 1, 0, 0.00, '2025-01-25 01:17:53', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(39, 35, 1, '35.79.01.1002', NULL, 'Tuyomerto', 'gunung-panderman-via-tuyomerto', 'Jalur wisata', '<ul><li>Informasi sumber air pendakian Gunung Panderman via Toyomerto tidak tersedia di puncak, namun ada beberapa titik sumber air di sepanjang jalur. Pendaki perlu membawa bekal air yang cukup, terutama jika berencana berkemah di puncak atau di sekitar Sabana Butak.&nbsp;<strong>(03-04-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 4, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 150.0000, 75.0000, 2.0000, 3.0000, 0.0150, 1, 0, 0.00, '2025-01-27 19:35:24', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(40, 36, 1, '12.17.06.2010', NULL, 'Ginolat', 'gunung-pusuk-buhit-via-ginolat', 'Jalur Wisata (foto : Kompas/Amir Sodikin - 2018)', '<ul><li>Informasi untuk sumber air di jalur pendakian Gunung Pusuk Buhit via Ginolat tidak banyak tersedia, sehingga pendaki disarankan untuk membawa persediaan air yang cukup.&nbsp;<strong>(03-07-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 5, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 1, 0, 0.00, '2025-01-28 18:51:36', '2025-08-01 23:21:10', 0.0200, 0.8000, 5.0000, 0.1500, 0.0700),
(41, 37, 1, '53.03.09.2007', NULL, 'Kuantabun (Timor Leste)', 'gunung-cutete-via-kuantabun-timor-leste', 'Jalur jelajah', '<ul><li>Belum ada sumber informasi mengenai sumber air, untuk pendakian di harapkan membawa air yang cukup untuk pendakian. &nbsp;<strong>(03-07-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 5, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 2, 0, 0.00, '2025-01-28 19:41:51', '2025-08-01 23:21:10', 0.0200, 0.8000, 5.0000, 0.1500, 0.0700);
