(42, 38, 1, '11.06.14.2011', NULL, 'Saree', 'gunung-seulawah-agam-via-saree', 'Jalur normal', '<ul><li>Sumber air di jalur pendakian Gunung Seulawah Agam via Saree, ada informasi menyatakan untuk sumber air di sekitar Pos 1, Pos 2, dan dekat puncak. Namun, disarankan untuk selalu membawa air yang cukup atau perlengkapan untuk menyaring air karena ketersediaan sumber air tidak selalu terjamin, terutama saat musim kemarau.&nbsp;<strong>(03-07-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 20, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 2, 0, 0.00, '2025-01-29 04:17:57', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(43, 39, 1, '53.08.14.2005', NULL, 'Moni', 'gunung-kelimutu-via-moni', 'Jalur wisata', '<ul><li>Tidak ada sumber informasi ketersediaan sumber air secara alami di sepanjang jalur pendakian. Pendaki perlu membawa air minum yang cukup dari Moni atau tempat lain sebelum memulai pendakian.&nbsp;<strong>(02-07-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 10, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 1, 0, 0.00, '2025-01-30 18:06:59', '2025-08-01 23:21:10', 0.0200, 0.8000, 5.0000, 0.1500, 0.0700),
(44, 40, 1, '52.06.07.2007', NULL, 'Sangiang Darat', 'gunung-sangeang-via-sangiang-darat', 'Jalur petualangan singkat', '<ul><li>Sumber: <a href=\"https://www.wikiloc.com/hiking-trails/gunungapi-176085140\">https://www.wikiloc.com/hiking-trails/gunungapi-176085140</a></li><li><strong>Gunung api sangat aktif</strong></li><li>Gunakan pemandu lokal</li><li>Tidak ada informasi adanya sumber air di jalur pendakian, bawalah air yang cukup saat pendakian&nbsp;<strong>(02-07-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 3, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 1, 0, 0.00, '2025-01-31 03:07:53', '2025-08-01 23:21:10', 0.0200, 0.8000, 5.0000, 0.1500, 0.0700),
(45, 41, 1, '16.72.02.1005', NULL, 'Kampung 4', 'gunung-dempo-via-kampung-4', 'Jalur favorit', '<ul><li>Ada sumber informasi yang meyatakan Sumber air hanya tersedia di Pos Cibunar, pos pertama setelah basecamp. Oleh karena itu, sangat penting untuk memperhitungkan kebutuhan air dan membawa wadah kosong untuk mengisi air di Pos Cibunar sebelum melanjutkan pendakian.<strong>(02-07-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 5, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 3, 0, 0.00, '2025-01-31 19:49:21', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(46, 42, 1, '33.19.08.2011', NULL, 'Rahtawu', 'gunung-muria-via-rahtawu', 'Jalur puncak tertinggi', '<ul><li>Ada sumber informasi menyatakan sumber air terdapat di sekitar pos-pos peristirahatan dan beberapa titik, akan tetapi diharapkan juga untuk sedia persesiaan air yang cukup dari baaah&nbsp;<strong>(02-07-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 6, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 2, 0, 0.00, '2025-02-01 02:39:18', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(47, 43, 1, '35.13.08.2009', NULL, 'Bremi (Bermi)', 'gunung-argopuro-via-bremi-bermi', 'Jalur normal trek panjang', '<ul><li>Balai Besar KSDA Jawa Timur menutup jalur Bremi mulai 1 Januari hingga 31 Desember 2025.&nbsp;<strong>(01-07-2025)</strong></li><li>Beberapa sumber menyebutkan untuk sumber air yaitu&nbsp; Danau Taman Hidup yang terletak di jalur Bremi. Selain itu, ada juga sumber air di Pos Mata Air II yang jaraknya sekitar 15 menit dari jalur pendakian. Namun, jalur Bremi dikenal memiliki lebih sedikit sumber air dibandingkan jalur Baderan, sehingga pendaki perlu membawa persediaan air yang cukup.&nbsp;<strong>(01-07-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 10, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 3, 0, 0.00, '2025-02-01 06:29:54', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(48, 44, 1, '35.18.04.2022', NULL, 'Bajulan (Jolotundo)', 'gunung-wilis-via-bajulan-jolotundo', 'Jalur wisata', '<ul><li>Data jalur dari <a href=\"https://www.wikiloc.com/outdoor-trails/wilis-via-bajulan-175120998\">https://www.wikiloc.com/outdoor-trails/wilis-via-bajulan-175120998</a></li><li>Adanya informasi yang menyatakan Sumber air utama di jalur pendakian Gunung Wilis via Bajulan dapat ditemukan di Pos Perijinan dan Pos 3 Sekartaji.&nbsp;<strong>(01-07-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 7, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 2, 0, 0.00, '2025-02-01 18:50:06', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(49, 45, 1, '33.09.01.2005', NULL, 'Selo', 'gunung-merbabu-via-selo', 'Pendakian Gunung Merbabu via Selo adalah sebuah petualangan yang memadukan tantangan fisik, keindahan alam, dan kepuasan spiritual. Gunung Merbabu, yang menjulang setinggi 3.145 meter di atas permukaan laut, menawarkan jalur pendakian yang populer melalui Kecamatan Selo, sebuah desa kecil yang terletak di antara Gunung Merbabu dan Gunung Merapi. Kecamatan Selo sendiri sudah menjadi ikon bagi para pendaki karena aksesnya yang relatif mudah dan pemandangannya yang memukau. Perjalanan pendakian akan ditemani dengan sabana yang luas sebelum mencapai puncak.', '<ul><li>Jalur Selo masih ditutup sementara hingga persiapan selesai (<strong>27-02-2025</strong>)</li><li>Penggunaan gelang pelacak (RFID) Radio Frequency IDentification, untuk pencegahan pendaki tersesat atau hilang, 1 kelömpok pendakian mendapatkan hanya 1 gelang <strong>( 12-06-2025 )</strong></li><li>Jalur Selo ditutup sementara tgl 2 hingga 3 Agustus 2025 persiapan selesai <strong>(31-07-2025</strong>)</li><li>Tidak ada sumber air alami di sepanjang jalur pendakian, bawalah air dan perbekalan yang cukup dari basecamp. <strong>(10-08-2025)</strong></li></ul>', '<ul><li><br></li></ul><div><br></div>', 1, , 1, 1, 1, 20, 0.7900, 1.0300, 1.0700, 35.2000, 11.6650, 5.2860, 0.0046, 125.0000, 0.0330, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 2, 2, 5.00, '2025-02-01 23:36:59', '2025-08-11 19:00:36', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700);
