(50, 45, 1, '33.08.07.2007', NULL, 'Suwanting', 'gunung-merbabu-via-suwanting', NULL, '<ul><li>Jalur Suwanting dibuka mulai 20 Februari 2025 (kuota 50%: 164 orang/hari) (<strong>27-02-2025</strong>)</li><li>Penggunaan gelang pelacak (RFID) Radio Frequency IDentification, untuk pencegahan pendaki tersesat atau hilang, 1 kelömpok pendakian mendapatkan hanya 1 gelang <strong>( 12-06-2025 )</strong></li><li>Sumber air di jalur pendakian Gunung Merbabu via Suwanting hanya ada di satu titik, yaitu di Pos Air. Pos ini terletak sekitar 2,5 hingga 3 jam perjalanan dari basecamp Suwanting <strong>(18-06-2025)</strong></li><li>Jalur Suwanting pada tgl 3 Agustus 2025 jumlah kuota pendakian menjadi 138 diharapkan untuk pendakian boking di www.tngunungmerbabu.org <strong>(31-07-2025</strong>)</li></ul><div><br></div>', '<ul><li>Tarif tiket mengikuti PP No. 36 Tahun 2024</li><li>Wajib mematuhi Protokol Wisata Pendakian sesuai SK Kepala Balai</li><li>Booking online wajib di www.tngunungmerbabu.org</li></ul>', 0, , 1, 1, 1, 20, 0.7900, 1.0300, 1.0700, 35.2000, 11.6650, 5.2860, 0.0046, 125.0000, 0.0320, 510.0000, 550.0000, 340.0000, 1500.0000, 75.0000, 60.0000, 2.0000, 3.0000, 0.0500, 3, 0, 0.00, '2025-02-01 23:46:32', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(51, 45, 1, '33.22.01.2002', NULL, 'Thekelan', 'gunung-merbabu-via-thekelan', NULL, '<ul><li>Jalur Thekelan masih ditutup sementara hingga persiapan selesai (<strong>27-02-2025</strong>)</li><li>Penggunaan gelang pelacak (RFID) Radio Frequency IDentification, untuk pencegahan pendaki tersesat atau hilang, 1 kelömpok pendakian mendapatkan hanya 1 gelang <strong>( 12-06-2025 )</strong></li><li>Sumber air di jalur pendakian Merbabu via Thekelan dapat ditemukan di beberapa titik, yaitu di Pos 1, Pos 2, dan Pos Pemancar. Selain itu, ada juga sumber mata air sebelum Pos 3 yang terletak di sebelah kanan jalur. <strong>(18-08-2025)</strong></li></ul><div><br></div>', '<ul><li>Tarif tiket mengikuti PP No. 36 Tahun 2024</li><li>Wajib mematuhi Protokol Wisata Pendakian sesuai SK Kepala Balai</li><li>Booking online wajib di www.tngunungmerbabu.org</li><li>Jalur Thekelan ditutup sementara tgl 1 hingga 31 Agustus 2025 persiapan selesai <strong>(31-07-2025</strong>)</li></ul><div><br></div><div><br></div>', 0, , 1, 1, 1, 35, 0.7900, 1.0300, 1.0700, 35.2000, 11.6650, 5.2860, 0.0046, 125.0000, 0.0330, 510.0000, 550.0000, 340.0000, 1500.0000, 75.0000, 60.0000, 2.0000, 3.0000, 0.0500, 2, 0, 0.00, '2025-02-01 23:53:34', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(52, 45, 1, '33.08.16.2016', NULL, 'Wekas', 'gunung-merbabu-via-wekas', NULL, '<ul><li>Foto: https://www.travelisto.web.id/paket-pendakian-gunung-merbabu-2d1n/</li><li>Penggunaan gelang pelacak (RFID) Radio Frequency IDentification, untuk pencegahan pendaki tersesat atau hilang, 1 kelömpok pendakian mendapatkan hanya 1 gelang <strong>( 12-06-2025 )</strong></li><li>Sumber air di jalur pendakian Gunung Merbabu via Wekas terletak di Pos 2, di mana terdapat dua aliran sungai yang membentuk air terjun <strong>(18-06-2025)</strong></li></ul>', '<ul><li>Tarif tiket mengikuti PP No. 36 Tahun 2024</li><li>Wajib mematuhi Protokol Wisata Pendakian sesuai SK Kepala Balai</li><li>Booking online wajib di www.tngunungmerbabu.org</li></ul><div><br></div><div><br></div>', 0, , 1, 1, 1, 20, 0.7900, 1.0300, 1.0700, 35.2000, 11.6650, 5.2860, 0.0046, 125.0000, 0.0330, 510.0000, 550.0000, 340.0000, 1500.0000, 75.0000, 60.0000, 2.0000, 3.0000, 0.0500, 2, 0, 0.00, '2025-02-01 23:57:10', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700);
