(53, 46, 1, '35.16.04.2004', NULL, 'Tamiajeng', 'gunung-penanggungan-via-tamiajeng', 'Jalur favorit wisata pendakian', '<ul><li>Tidak ada informasi yang menyatakan adanya sumber air di jalur pendakian ini, di sarankan untuk membawa persediaan air yang cukup.&nbsp;<strong>(01-07-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 8, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 1, 0, 0.00, '2025-02-11 00:00:36', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(55, 21, 1, '51.07.07.2004', NULL, 'Pura Pasar Agung', 'gunung-agung-via-pura-pasar-agung', 'Jalur alternatif\r\nFoto: Michelle Thomas - googlemap (Januari 2024)', '<ul><li>Status jalur pendakian : Di Tutup 25 Februari 2025 hingga 5 hari kedepan (<strong>27-02-2025</strong>)</li><li>Sumber air di jalur pendakian Gunung Agung via Pura Pasar Agung dianggap suci dan tidak boleh diambil oleh pendaki. Pura Pasar Agung merupakan titik awal pendakian ke Gunung Agung melalui jalur selatan. Jalur ini relatif lebih pendek dan cepat, memakan waktu sekitar 4-5 jam untuk mencapai puncak kedua (3.035 mdpl). Namun, penting untuk diingat bahwa ada larangan untuk tidak mengambil air dari sumber mata air yang ada di jalur ini karena dianggap disucikan.&nbsp; Baiknya membawa perbekalan air yang cukup untuk epnadian <strong>(19-06-2025)</strong></li></ul>', '<ul><li>Ada larangan untuk tidak mengambil air dari sumber mata air yang ada di jalur ini karena dianggap disucikan.&nbsp; <strong>(19-08-2025)</strong></li></ul>', 0, , 1, 1, 1, 6, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 2, 0, 0.00, '2025-02-27 01:30:57', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(56, 3, 1, '33.23.03.1003', NULL, 'Butuh-Kaliangkrik', 'gunung-sumbing-via-butuh-kaliangkrik', 'Foto: Akil Tokel (googlemap - Mei 2022)', '<ul><li>Sumber air di jalur pendakian Gunung Sumbing via Kaliangkrik, khususnya via Dusun Butuh, umumnya tersedia di beberapa titik, terutama di dekat Pos 1 dan di sepanjang jalur menuju Pos 2. Beberapa sumber air yang bisa dimanfaatkan antara lain aliran sungai dan mata air yang ada di sepanjang jalur, disarankan untuk tetap membawa persediaan air yang cukup dari basecamp atau titik awal pendakian, terutama jika berencana untuk mendaki dalam waktu yang lama atau kondisi cuaca tidak menentu. &nbsp;<strong>(18-06-2025)</strong></li></ul>', '<div>belum ada untuk sekarang</div>', 0, , 1, 1, 1, 8, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 3, 0, 0.00, '2025-02-28 16:23:34', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(57, 3, 1, '33.23.02.2013', NULL, 'Banaran', 'gunung-sumbing-via-banaran', 'Jalr pendakian timur\r\nFoto: Muhammad Arifin (googlemap - Oktober 2023)', '<ul><li>Sumber air di jalur pendakian Gunung Sumbing via Banaran terletak sekitar 75 meter setelah Pos 4 (Watu Ondo) &nbsp;<strong>(18-04-2025)</strong></li></ul>', NULL, 0, , 1, 1, 1, 7, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 3, 0, 0.00, '2025-02-28 22:55:35', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(58, 47, 1, '35.14.10.1008', NULL, 'Tretes', 'gunung-arjuno-arjuna-via-tretes', 'Jalur normal\r\nFoto: Achmd Dill (googlemap - September 2022)', '<ul><li>Ada sumber yang menyatakan untuk sumber air di jalur pendakian Gunung Arjuno via Tretes melimpah dan tersedia di setiap pos pendakian. Pendaki dapat memanfaatkan sumber mata air yang ada di Pos Pet Bocor, Pos Kop-kopan, Pos Pondokan, dan Pos Lembang Kidang.&nbsp;<strong>(01-07-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 12, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 3, 3, 5.00, '2025-03-01 22:40:31', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(59, 48, 1, '32.05.20.2001', NULL, 'Pos Security', 'gunung-papandayan-via-pos-security', 'Jalur wisata\r\nFoto: Atika Pane (googlemap - Juli 2019)', '<ul><li>Beberapa sumber menyebutkan Pos Security, yang juga dikenal sebagai Pos 7, terletak di area parkir dekat pintu masuk pendakian. Area ini dilengkapi dengan toilet umum dan warung makan, serta menjadi titik persimpangan jalur menuju Hutan Mati dan Ghober Hoet. Sumber air di sini berasal dari mata air Gunung Papandayan, dan pendaki dapat mengisi persediaan air mereka.&nbsp;<strong>(01-07-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 17, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 1, 0, 0.00, '2025-03-01 23:55:47', '2025-08-01 23:21:10', 0.0200, 0.8000, 5.0000, 0.1500, 0.0700),
(60, 11, 1, '32.01.29.2008', NULL, 'Ajisaka', 'gunung-salak-via-ajisaka', 'Jalur baru\r\nFoto cover: Pras131 (googlemap - November 2022)', '<ul><li>Jalur ini juga dikenal memiliki sumber air yang langka. Jadi bawalah air yang cukup untuk proses pendakian&nbsp;<strong>(23-06-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 6, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 3, 0, 0.00, '2025-03-03 01:55:46', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(61, 49, 1, '33.22.20.2006', NULL, 'Mawar', 'gunung-ungaran-via-mawar', 'Jalur wisata pendakian favorit\r\nFoto: Inung Beni Priyono (googlemap - Juni 2018)', '<ul><li>Sumber air di jalur pendakian Gunung Ungaran via Mawar terletak di Pos 2. Sumber air ini berupa mata air alami yang jernih dan dapat dimanfaatkan oleh para pendaki untuk mengisi persediaan air selama perjalanan.&nbsp;<strong>(01-07-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 6, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 2, 0, 0.00, '2025-03-04 00:30:12', '2025-08-01 23:21:10', 0.0200, 0.8000, 5.0000, 0.1500, 0.0700),
(62, 50, 1, '33.08.17.2005', NULL, 'Sawit', 'gunung-andong-via-sawit', 'Jalur wisata favorit\r\nFoto: John Stefanus Chandra (googlemap - Desember 2022)', '<ul><li>Beberapa sumber menyebutkan Sumber air di jalur pendakian Gunung Andong via Sawit berada di antara Pos 2 dan Pos 3, tepatnya di jalur pendakian lama.&nbsp;<strong>(01-07-2025)</strong></li></ul>', '<ul><li>Jalur di tutup, Rencana buka tanggal 2 April 2025 &lt;<strong>01-04-2025&gt;</strong></li></ul>', 0, , 1, 1, 1, 4, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 1, 0, 0.00, '2025-03-04 18:12:53', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(63, 17, 1, '32.08.18.2009', NULL, 'Palutungan', 'gunung-ceremai-via-palutungan', 'Foto: Muhammad Rifki Nurdiansyah (googlemap - Agustus 2024)', '<ul><li>Beberapa sumber menyebutkan bahwa Sumber air utama di jalur pendakian Gunung Ciremai via Palutungan berada di Pos Cigowong, yang merupakan pos pertama setelah melewati basecamp Palutungan. Setelah melewati Pos Cigowong, tidak ada lagi sumber air hingga ke puncak, jadi disarankan untuk mengisi persediaan air di pos ini.&nbsp;<strong>(01-07-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 8, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 3, 0, 0.00, '2025-03-05 07:06:45', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700);
