(67, 51, 1, '15.01.15.2012', NULL, 'Sungai Jernih', 'gunung-gunung-tujuh-via-sungai-jernih', 'Foto: Supriyanto Wibowo (googlemap - Desember 2018)', '<ul><li>Sumber air utama saat mendaki Gunung Tujuh via Sungai Jernih adalah Sungai Jernih itu sendiri yang mengalir dari Danau Gunung Tujuh. Sungai ini memiliki air yang jernih dan dingin, dan menjadi teman perjalanan selama pendakian dari batas taman nasional hingga Pos 1. &nbsp;<strong>(24-06-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 30, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 2, 0, 0.00, '2025-03-06 16:27:22', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
