(74, 58, 1, '18.06.20.2002', NULL, 'Campang', 'gunung-tanggamus-via-campang', 'Foto:  Dwi Nurcahyani (googlemap - Januari 2023)', '<ul><li>Sumber air di jalur pendakian Gunung Tanggamus via Campang dapat ditemukan di beberapa titik. Di basecamp Sonokeling, terdapat sumber air yang mengalir perlahan dari tebing dan ditampung untuk digunakan oleh pendaki. Selain itu, di sepanjang jalur, terutama dekat mata air atau aliran sungai kecil, pendaki bisa menemukan sumber air untuk mengisi persediaan. <strong>(09-07-2025)</strong></li></ul>', '<div>at this moment</div>', 0, , 1, 1, 1, 6, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 2, 0, 0.00, '2025-03-07 21:34:45', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
