(83, 65, 1, '32.18.09.2007', NULL, 'Taman Wisata Alam [-Loop-]', 'gunung-cagar-alam-pangandaran-via-taman-wisata-alam-loop', 'Jalur wisata\r\nFoto: Wayan Lindu (googlemap', '<ul><li><strong>Loop</strong> : memutar dengan jalur berbeda untuk kembali ke titik keberangkatan</li><li>Untuk perjalanan <strong>Loop</strong>, definisi <strong>naik </strong>dan <strong>turun</strong> mohon diabaikan</li><li>Di Taman Wisata Alam Pangandaran, terdapat beberapa sumber air yang bisa ditemukan di jalur pendakian. Salah satunya adalah Ci Rengganis, yang dikenal juga sebagai mata air yang dipercaya bisa membantu mempercepat mendapatkan jodoh. Selain itu, terdapat juga Curug Citumang, yang merupakan aliran sungai yang membelah hutan dan memiliki air terjun yang mengalir ke laut.&nbsp;<strong>(09-07-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 8, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 1, 0, 0.00, '2025-03-22 21:06:57', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(84, 66, 1, '36.02.20.2002', NULL, 'Cibareno', 'gunung-cibareno-via-cibareno', 'Jalur wisata\r\nFoto: Hariyaldi Deblo (googlemap - Juli 2022)', '<ul><li>Kualitas air sungai di jalur pendakian Cibareno perlu diperhatikan. Pendaki disarankan untuk melakukan penyaringan atau pengolahan air sebelum dikonsumsi, terutama jika air berasal dari sumber yang belum terjamin kebersihannya, sehingga di harapkan membawa perbekalan dan air yang vukup sebelum memulai pendakian.&nbsp;<strong>(09-07-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 7, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 1, 0, 0.00, '2025-03-24 15:35:01', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
