(90, 72, 1, '53.10.12.1007', NULL, 'Vila Ria (Waso)', 'gunung-poco-ngandonalu-via-vila-ria-waso', 'Jalur utama\r\nFoto:  Adrianus T. Jaya (obortimur.com)', '<ul><li>Sumber air di jalur pendakian Gunung Poco Ngandonalu via Villa Ria terdapat pada ketinggian 1.626 mdpl, berupa sungai kecil yang diseberangi. Jalur pendakian mengikuti pipa air plastik yang menanjak di lereng bukit curam. Setelah melewati sungai, jalur menjadi lebih jelas dan mengarah dari dekat Villa Ria.&nbsp;<strong>(07-07-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 8, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 3, 0, 0.00, '2025-04-16 00:56:39', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
