(97, 78, 1, '35.11.18.2004', NULL, 'Sumberwringin', 'gunung-raung-via-sumberwringin', 'Jalur klasik\r\nFoto: Vovo Susatio (Tribuntravel.com - Agustus 2016)', '<ul><li>tidak memiliki sumber air yang banyak di sepanjang jalur pendakian, terutama setelah melewati Pos 3. Pendaki disarankan untuk membawa persediaan air yang cukup atau memanfaatkan sumber air yang ada di pos-pos awal. <strong>(20-06-2025)</strong></li></ul>', '<ul><li>Jalur pendakian Gunung Raung di Bondowoso ditutup sementara usai erupsi pada 5 Juni 2025 <strong>(08-06-2025)</strong></li></ul>', 0, , 1, 1, 1, 15, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 3, 0, 0.00, '2025-05-04 05:57:12', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(98, 79, 1, '32.04.17.2010', NULL, 'Warjabakti', 'gunung-haruman-via-warjabakti', 'Jalur wisata', '<ul><li>Jalur pendakian Gunung Haruman via Warjabakti memiliki beberapa sumber air yang dapat dimanfaatkan oleh pendaki. Sumber air utama biasanya terdapat di sekitar mata air atau sungai kecil yang mengalir di jalur pendakian. Walaupun sumber air melimpah untuk mengambil air dari sumber alami, selalu bawa perlengkapan penyaringan air untuk memastikan air tersebut aman untuk diminum, serta sedia perbekalain air yang cukup juga dari bawah untuk kenyamanan pendakian&nbsp;<strong>(06-07-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 12, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 2, 0, 0.00, '2025-05-08 06:10:46', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(99, 80, 1, '32.02.03.2007', NULL, 'Sirnarasa', 'gunung-telaga-via-sirnarasa', 'Jalur wisata.\r\nFoto: Mario Agung (googlemap - Desember 2024)', '<ul><li>Jalur pendakian Gunung Telaga via Sirnarasa memiliki beberapa sumber air. Titik sumber air yang paling umum adalah di Pos 1, tidak ada lagi sumber air yang tersedia. Oleh karena itu, pendaki disarankan untuk membawa air yang cukup atau mengisi ulang persediaan air di Pos 1 sebelum melanjutkan pendakian.&nbsp;<strong>(07-07-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 4, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 2, 0, 0.00, '2025-05-11 02:13:11', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700);
