(100, 81, 1, '33.26.04.2002', NULL, 'Gumelem', 'gunung-rogojembangan-via-gumelem', 'Jalur wisata.\r\nFoto: Muryo Setyo (transpekalongan - 2015)', '<ul><li>Meskipun dikenal memiliki banyak sumber mata air, beberapa sumber menyebutkan bahwa pendaki juga perlu membawa persediaan air sendiri karena tidak semua jalur pendakian memiliki akses langsung ke sumber air.&nbsp;<strong>(20-06-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 25, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 2, 0, 0.00, '2025-05-11 18:05:28', '2025-08-01 23:21:10', 0.0200, 0.8000, 5.0000, 0.1500, 0.0700),
(101, 82, 1, '32.15.28.2003', NULL, 'Mekarbuana', 'gunung-sanggabuana-via-mekarbuana', 'Jalur wisata.\r\nFoto: Goodnewsfromindonesia.com', '<ul><li>Sumber air di jalur pendakian Gunung Sanggabuana via Mekarbuana umumnya terdapat di sekitar area mata air yang disebut \"Pancuran Emas\", untuk pendakian harus mempersiapkan air yang cukup dari bawah karena tidak terdapat di sepanjang jalur&nbsp;<strong>(04-07-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 12, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 2, 0, 0.00, '2025-05-11 19:01:48', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(102, 83, 1, '51.07.05.2003', NULL, 'Pantai Amed', 'gunung-bunutan-karangasem-via-pantai-amed', 'Jalur wisata\r\nFoto: Virtual Indonesia (googlemap - April 2019)', '<ul><li>Sumber air utama di jalur pendakian Bunutan via Pantai Amed adalah di sekitar area basecamp atau titik awal pendakian. Selain itu, ada juga kemungkinan sumber air lain di sepanjang jalur, namun informasinya tidak spesifik, di sarankan untuk membawa air yang cukup dari bawah&nbsp;<strong>(07-07-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 10, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 1, 0, 0.00, '2025-05-12 03:20:08', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(103, 84, 1, '51.02.09.2008', NULL, 'Candikuning', 'gunung-tapak-via-candikuning', 'Jalur wisata.\r\nFoto: Chriskomang', '<ul><li>Jalur pendakian Gunung Tapak via Candikuning dikabarkan memiliki sumber air yang melimpah di sepanjang jalur, tetapi belum ada informasi spesifik mengenai titik-titik sumber air, sehingga pendaki harus tetap mempersiapkan air dari bawah.&nbsp;<strong>(06-07-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 25, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 2, 0, 0.00, '2025-05-12 04:17:17', '2025-08-01 23:21:10', 0.0200, 0.8000, 5.0000, 0.1500, 0.0700);
