(107, 49, 1, '33.22.20.1011', NULL, 'Perantunan', 'gunung-ungaran-via-perantunan', 'Jalur normal.\r\nFoto: Setiawan Suryatmoko (googlemap - Juli 2024)', '<div>sumber air terutama di dekat Pos 1 dan Pos 2, Sumber air ini bisa dimanfaatkan pendaki untuk mengisi persediaan air minum selama pendakian<strong>. (19-06-2025)</strong></div>', '<div>none at this time</div>', 0, , 1, 1, 1, 12, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 1, 1, 5.00, '2025-05-29 04:40:36', '2025-08-13 20:26:51', 0.0200, 0.8000, 5.0000, 0.1500, 0.0700),
(108, 88, 1, '81.01.11.2015', NULL, 'Piliana', 'gunung-binaiya-via-piliana', 'Gunung Tertinggi.\r\nFoto: Jhon Peakk (googlemap - Maret 2021)', '<ul><li>Sumber air di jalur pendakian Gunung Binaiya via Piliana dapat ditemukan di beberapa titik. Sungai Yahe Atas adalah salah satu sumber air yang cukup besar dan jernih yang bisa dimanfaatkan. Selain itu, ada juga beberapa titik sumber air lainnya di sepanjang jalur pendakian, terutama sebelum mencapai Pos 2 (Aimoto). Namun, setelah Pos 2, sumber air mulai terbatas dan hanya berupa genangan yang kadang keruh. Gunakan air dengan baik untuk menghindari kekurangan saat pendakian.&nbsp;<strong>(07-07-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 20, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 3, 0, 0.00, '2025-05-31 23:34:42', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(109, 89, 1, '36.02.06.2008', NULL, 'Terminal Ciboleger [-Loop-]', 'gunung-desa-baduy-via-terminal-ciboleger-loop', 'Jalur wisata.\r\nFoto: Tirtagt Tech (googlemap -  Maret 2017)', '<ul><li><strong>Loop</strong> : memutar dengan jalur berbeda untuk kembali ke titik keberangkatan</li><li>Untuk perjalanan <strong>Loop</strong>, definisi <strong>naik </strong>dan <strong>turun</strong> mohon diabaikan</li></ul><div><br></div>', '<div>none at this time</div>', 0, , 1, 1, 1, 20, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 100.0000, 150.0000, 2.0000, 3.0000, 0.0500, 2, 0, 0.00, '2025-06-08 19:29:34', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(110, 90, 1, '35.79.01.1002', NULL, 'Pesanggrahan', 'gunung-butak-via-pesanggrahan', 'Jalur Wisata.\r\nFoto: Lee Siebert (Wikipedia -  Smithsonian Institution, 2000)', '<ul><li>Sumber Air di jalur pendakian Pos 1, 2 dan pos 4, meskipun ada sumber air di beberapa titik, sebaiknya tetap membawa persediaan air yang cukup untuk kebutuhan selama pendakian, terutama jika berencana mendaki saat cuaca sedang panas atau kondisi jalur sedang kering.&nbsp;<strong>(18-06-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 20, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 2, 0, 0.00, '2025-06-15 04:32:34', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700);
