(111, 91, 1, '73.06.04.1010', NULL, 'Pattapang', 'gunung-bawakaraeng-via-pattapang', 'Jalur normal.\r\nFoto: Abdurrahman Hasan / Beddu (googlemap - Oktober 2021)', '<ul><li>Beberapa suber menyatakan untuk sumber air ada di beberapa pos, tetapi disarankan untuk pendakian membawa air yang cukup dari bawah karena ketersediaan sumber air alami di jalur pendakian tidak selalu terjamin. <strong>(02-07-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 20, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 3, 0, 0.00, '2025-06-18 06:45:54', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
