(114, 93, 1, '35.05.17.2007', NULL, 'Panderman', 'gunung-gunung-kawi-via-panderman', 'Jalur Normal', '<ul><li>Ada sumber informasi menyatakn jalur ini memiliki sumber air yang cukup melimpah, terutama di dekat Pos 1 dan sekitar Pos 2, dengan sungai kecil di pegunungan. Namun, perlu diperhatikan bahwa setelah Pos 5, persediaan air mulai menipis, jadi sebaiknya bawa persediaan yang cukup.&nbsp;<strong>(02-07-2025)</strong></li></ul>', '<div>none</div>', 0, , 1, 1, 1, 15, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 2, 0, 0.00, '2025-06-26 04:14:44', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(115, 5, 1, '35.20.07.1013', NULL, 'Singolangu', 'gunung-lawu-via-singolangu', 'Jalur tertua .\r\nFoto: Basecamp Singolangu (googlemap - April 2019)', '<ul><li>Di jalur pendakian Gunung Lawu via Singolangu, terdapat beberapa sumber mata air yang bisa dimanfaatkan pendaki. Salah satunya adalah Sendang Sanggar, yang berada di dekat jalur dan area camping Kiteran. Selain itu, di jalur ini juga terdapat mata air di dekat Pos 2.&nbsp;<strong>(11-07-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 12, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 3, 0, 0.00, '2025-07-10 23:53:35', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
