(117, 1, 1, '33.07.08.2021', NULL, 'Alang-alang Sewu', 'gunung-sindoro-via-alang-alang-sewu', 'Jalur alternatif favorit.\r\nFoto: Stefina Paritta (googlemap - September 2019)', '<ul><li>Sumber air di jalur pendakian Gunung Sindoro via Alang-Alang Sewu terdapat di sekitar Pos 1 dan Pos 2. Tepatnya, pendaki akan menemukan sumber mata air di antara Pos 1 dan Pos 2, yang sudah dipasangi pipa dan kran oleh pihak pengelola. Selain itu, ada juga sumber mata air lain yang terletak sekitar 100 meter dari Simpang Nggopitan, yang merupakan persimpangan jalur pendakian dan tempat pengambilan air terakhir.&nbsp;<strong>(13-07-2024)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 15, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 3, 0, 0.00, '2025-07-12 18:57:29', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(118, 95, 1, '32.04.07.2005', NULL, 'Cikoneng Satu', 'gunung-manglayang-via-cikoneng-satu', 'Jalur Wisata.\r\nFoto: William Kohler (Wikipedia - 9 September 2015)', '<ul><li>Sumber air pada jalur pendakian Manglayang via Cikoneng Satu tidak disebutkan secara spesifik dalam informasi yang tersedia. Karena tidak ada informasi detail tentang sumber air di jalur ini, disarankan untuk membawa persediaan air yang cukup atau mencari informasi lebih lanjut dari pendaki lain yang pernah melalui jalur ini.&nbsp;<strong>(13-07-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 15, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 2, 0, 0.00, '2025-07-12 20:51:17', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700),
(119, 96, 1, '18.01.06.2004', NULL, 'Sumur Kumbang', 'gunung-rajabasa-via-sumur-kumbang', 'Jalur utama.\r\nFoto: Ferry Irawan (googlemap -  Januari 2024)', '<ul><li>Mengingat jalur pendakian Gunung Rajabasa via Sikumbang tidak secara spesifik menyebutkan sumber air, sangat disarankan untuk membawa persediaan air minum dan perbekalan yang cukup untuk kebutuhan selama pendakian.&nbsp;<strong>(18-07-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 15, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 2, 0, 0.00, '2025-07-13 05:50:13', '2025-08-01 23:21:10', 0.0200, 0.8000, 3.5000, 0.1500, 0.0700);
INSERT INTO `rute` (`id`, `gunung_id`, `negara_id`, `kode_desa`, `lokasi`, `nama`, `slug`, `deskripsi`, `informasi`, `aturan_dan_larangan`, `is_verified`, `rute`, `is_cuaca_siap`, `is_kalori_siap`, `is_kriteria_jalur_siap`, `segmentasi`, `a_k`, `b_k`, `c_k`, `d_k`, `a_wt`, `b_wt`, `c_wt`, `d_wt`, `e_wt`, `f_wt`, `a_cps`, `b_cps`, `c_kr`, `d_kr`, `e_kr`, `f_kr`, `g_kr`, `h_kr`, `rute_tingkat_kesulitan_id`, `comment_count`, `comment_rating`, `created_at`, `updated_at`, `g_wt`, `h_wt`, `i_wt`, `j_wt`, `k_wt`) VALUES
(120, 97, 1, '52.03.04.2011', NULL, 'Flush Harmony [-Loop-]', 'gunung-tetebatu-via-flush-harmony-loop', 'Jalur Pariwisata.\r\nFoto: Flush Harmony (googlemap - Juni 2025)', '<ul><li><strong>Loop</strong> : memutar dengan jalur berbeda untuk kembali ke titik keberangkatan</li><li>Untuk perjalanan <strong>Loop</strong>, definisi <strong>naik </strong>dan <strong>turun</strong> mohon diabaikan</li><li>Sumber air di jalur pendakian Tetebatu via Flush Harmony Gunung Rinjani sebagian besar berasal dari mata air alami yang terdapat di sepanjang jalur pendakian dan di sekitar desa Tetebatu. Beberapa air terjun yang ada di dekat jalur pendakian juga menjadi sumber air, seperti Air Terjun Tibu Topat dan Air Terjun Lembah Rinjani, perlu kehati-hatian saat mengambil air dari air terjun karena kondisi medan yang mungkin curam. <strong>(18-07-2025)</strong></li></ul><div><br><br></div><div><br></div>', '<div>none at this time</div>', 0, , 1, 1, 1, 15, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 100.0000, 150.0000, 2.0000, 3.0000, 0.0500, 1, 0, 0.00, '2025-07-13 06:24:55', '2025-08-02 04:56:00', 0.0200, 0.8000, 5.0000, 0.1500, 0.0700),
(121, 98, 1, '32.04.38.2009', NULL, 'Situ Patenggang', 'gunung-kawah-putih-via-situ-patenggang', 'Jalur Wisata.\r\nFoto: Anita Yuliani (googlemap - Agustus 2024)', '<ul><li>Sumber air yang terdapat di jalur pendakian Kawah Putih menuju Situ Patenggang tidak ada informasi spesifik mengenai sumber air di jalur pendakian, kemungkinan terdapat sumber air alami seperti sungai atau mata air kecil yang dapat dimanfaatkan untuk keperluan selama pendakian. Namun, perlu diingat bahwa air dari Kawah Putih tidak aman untuk diminum karena mengandung belerang. bawalah air minum dan perbekalan yang cukup.&nbsp;<strong>(18-07-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 10, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 2, 0, 0.00, '2025-07-14 03:42:06', '2025-08-01 23:21:10', 0.0200, 0.8000, 5.0000, 0.1500, 0.0700),
(122, 99, 1, '33.07.13.2002', NULL, 'Sikunang', 'gunung-bismo-via-sikunang', 'Jalur Wisata.\r\nFoto: Vibungsan (googlemap - September 2022)', '<ul><li>Sumber air di jalur pendakian Gunung Bismo via Sikunang, tidak ada informasi spesifik tentang sumber air di jalur Sikunang, penting untuk selalu membawa persediaan air yang cukup saat mendaki gunung. Pastikan membawa air minum yang cukup untuk perjalanan pendakian.&nbsp;<strong>(18-07-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 6, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 1, 0, 0.00, '2025-07-14 20:37:25', '2025-08-01 23:21:10', 0.0200, 0.8000, 5.0000, 0.1500, 0.0700),
(123, 100, 1, '32.11.14.2004', NULL, 'Sindulang', 'gunung-kerenceng-via-sindulang', 'Jalur Wisata.\r\nFoto: Rafli Emd (googlemap - September 2018)', '<ul><li>sumber air di jalur pendakian Gunung Kerenceng via Sindulang, beluam ada informasi sepesifik mengenai sumber air, sebaiknya untuk membawa air dan perbekalan yang cukup jika akan melakukan pendakian.&nbsp;<strong>(18-07-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 8, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 60.0000, 50.0000, 2.0000, 3.0000, 0.0500, 2, 0, 0.00, '2025-07-15 02:34:48', '2025-08-01 23:21:10', 0.0200, 0.8000, 5.0000, 0.1500, 0.0700),
(124, 101, 1, '53.09.15.2002', NULL, 'Inelika (Wow Glamping)', 'gunung-kawah-wawomudha-via-inelika-wow-glamping', 'Jalur Wisata.\r\nFoto: Rezki Win (googlemap - Maret 2022),  Grasian Sawu (googlemap-Januari 2017)', '<ul><li>Jalur pendakian Kawah Wawomudha via Inielika memiliki beberapa sumber air yang bisa dimanfaatkan pendaki. Sumber air utama adalah air panas alami di Mengeruda, yang terletak di kaki Gunung Inielika. Selain itu, terdapat juga sumber air di sekitar danau Wawomudha, yang terbentuk setelah letusan Gunung Wawomudha. <strong>(18-07-2025)</strong></li></ul>', '<div>none at this time</div>', 0, , 1, 1, 1, 15, 0.7900, 1.0300, 1.0700, 35.2000, 11.6651, 5.2865, 0.0046, 125.0000, 0.0331, 510.0000, 550.0000, 340.0000, 1500.0000, 700.0000, 250.0000, 2.0000, 3.0000, 0.0500, 1, 1, 5.00, '2025-07-15 03:10:15', '2025-08-01 23:21:10', 0.0200, 0.8000, 5.0000, 0.1500, 0.0700),
